import React, { useState } from "react";
import { Link } from "react-router-dom";

// Modal Component
const ProbesKorun = () => {
  const [isOpenModal, setIsOpenModal] = useState(false);
  
    const [formData, setFormData] = useState({ username: "", password: "" });

    const handleOpen = () => {
        setIsOpenModal(true);
      };
    
      // Modal বন্ধ করার ফাংশন
      const handleClose = () => {
        setIsOpenModal(false);
      };
    
      const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
      };
    

      const handleSubmit = (e) => {
        e.preventDefault();
        console.log("User Data:", formData);
      };

  if (!isOpenModal) return null; // Don't render if the modal is closed

  return (
    <div className="flex items-center justify-center  ">
            {/* প্রবেশ করুন Button */}
            <button
              onClick={handleOpen}
              className="border border-white px-4 py-2 hover:border-orange-500 outline-none rounded-sm text-white"
            >
              প্রবেশ করুন
            </button>

            {/* Modal */}
            {isOpenModal && (
              <div
                className="fixed inset-0 z-50 flex items-center justify-center bg-black bg-opacity-50"
                onClick={handleClose} // বাইরে ক্লিক করলে বন্ধ হবে
              >
                <div
                  className="bg-white  rounded-md shadow-md w-80 "
                  onClick={(e) => e.stopPropagation()} // Modal এ ক্লিক করলে বন্ধ হবে না
                >
                  {/* Close Button (Using SVG) */}
                  <div className="flex flex-row px-5 py-3 items-center justify-between bg-common-blue">
                    <div>
                      <h2 className=" font-semibold text-white ">
                        ব্র্যান্ড] এ স্বাগতম
                      </h2>
                    </div>
                    <div>
                      <button
                        onClick={handleClose}
                        className=" text-gray-600 hover:text-red-500"
                      >
                        <svg
                          xmlns="http://www.w3.org/2000/svg"
                          className="w-6 h-6"
                          viewBox="0 0 24 24"
                          fill="none"
                          stroke="white"
                          strokeWidth="2"
                          strokeLinecap="round"
                          strokeLinejoin="round"
                        >
                          <line x1="18" y1="6" x2="6" y2="18" />
                          <line x1="6" y1="6" x2="18" y2="18" />
                        </svg>
                      </button>
                    </div>
                  </div>

                  {/* Modal Title */}

                  {/* Form */}
                  <form onSubmit={handleSubmit} className="space-y-3">
                    <div className="px-5 py-8  ">
                      <div>
                        <h3 className="text-black">ব্যবহারকারীর নাম</h3>
                        <input
                          type="text"
                          name="ব্যবহারকারীর নাম"
                          placeholder="এখানে পূরণ করুন"
                          className="w-full p-2 text-black border  rounded-md focus:outline-none focus:ring-1 focus:ring-red-500"
                          onChange={handleChange}
                        />
                      </div>
                      <div className="">
                        <h3 className="text-black"> গোপন নম্বর</h3>
                        <input
                          type="password"
                          name="password"
                          placeholder="এখানে পূরণ করুন"
                          className="w-full p-2 border text-black  rounded-md focus:outline-none focus:ring-1 focus:ring-red-500"
                          onChange={handleChange}
                        />
                        <div className="flex justify-end">
                          <p className="my-2 text-end text-black text-sm cursor-pointer hover:text-common-blue hover:border-b hover:border-common-blue w-fit whitespace-nowrap">
                            পাসওয়ার্ড ভুলে গেছেন?
                          </p>
                        </div>
                      </div>
                      <div>
                        <button
                          type="submit"
                          className="w-full bg-orange-500 text-white py-2 rounded-md hover:bg-orange-600"
                        >
                          প্রবেশ করুন
                        </button>

                        <p className="mt-2  text-black text-sm cursor-pointer   w-fit">
                          অ্যাকাউন্ট নেই?<Link>নিবন্ধন</Link>
                        </p>
                      </div>
                    </div>
                  </form>
                </div>
              </div>
            )}
          </div>
  );
};

export default ProbesKorun;
